import React from 'react'
import{makeStyles,Drawer,CssBaseline,AppBar,Toolbar,List,Typography,Divider,ListItem} from '@material-ui/core'

const drawerWidth = 240;
const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  appBar: {
    width: `calc(100% - ${drawerWidth}px)`,
    marginLeft: drawerWidth,
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: drawerWidth,
  },
  toolbar: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.default,
    padding: theme.spacing(3),
  },
  active: {
    backgroundColor: "red"
  }
}));

const Main=()=>{
  const classes = useStyles();
  return(
    <div>
    <AppBar position="fixed" className={classes.appBar}>
      <Toolbar>
        <Typography h6 noWrap>
          Satellight
        </Typography>
      </Toolbar>
    </AppBar>
    <Drawer
      className={classes.drawer}
      variant="permanent"
      classes={{
        paper: classes.drawerPaper,
      }}
      anchor="left"
    >
      <div className={classes.toolbar} />
      <Divider />
      <List>
        <ListItem selected={menu==1} onClick={()=>{setMenu(1)}} button>
          <ListItemIcon><InboxIcon /> </ListItemIcon>
          <ListItemText primary={'Open Project'} />
        </ListItem>

        <ListItem selected={menu==2} onClick={()=>{setMenu(2)}} button>
          <ListItemIcon><MailIcon /> </ListItemIcon>
          <ListItemText primary={'Manage Projects'} />
        </ListItem>

        <ListItem selected={menu==3} onClick={()=>{setMenu(3)}} button>
          <ListItemIcon><InboxIcon /> </ListItemIcon>
          <ListItemText primary={'Merge'} />
        </ListItem>
        <ListItem selected={menu==4} onClick={()=>{setMenu(4)}} button>
          <ListItemIcon><MailIcon /> </ListItemIcon>
          <ListItemText primary={'Manage Users'} />
        </ListItem>
      </List>
      <Divider />
    </Drawer>
    </div>
  )
}

export default Main
